import './style/ed.css'

const EarthDay = () =>{
    return(
        <>
            <div className="Body" id='EarthDay-B'>
                <div className="tophead-ED">
                    <h3 className="h3">Earth Day</h3>
                </div>
            </div>
        </>
    )
}

export { EarthDay }
